    Opal.def(self, '$get_scene_table', $Insane_Korean_get_scene_table$4 = function $$get_scene_table() {
      var self = this, table = nil;

      
      table = ["\uD53C \uB0C4\uC0C8\uAC00 \uC9C0\uB3C5\uD788 \uD48D\uAE34\uB2E4. \uC0AC\uAC74\uC778\uAC00? \uC0AC\uACE0\uC778\uAC00? \uD639\uC2DC, \uC544\uC9C1 \uB05D\uB098\uC9C0 \uC54A\uC740 \uAC78\uAE4C?", "\uC774\uAC74\u2026\u2026\uAFC8\uC778\uAC00? \uC774\uBBF8 \uB05D\uB0AC\uC744 \uC77C\uC774 \uAE30\uC5B5 \uC18D\uC5D0\uC11C \uB418\uC0B4\uC544\uB09C\uB2E4.", "\uC544\uB798\uC5D0 \uD3BC\uCCD0\uC9C4 \uAC70\uB9AC\uB97C \uB0B4\uB824\uB2E4\uBCF4\uACE0 \uC788\uB2E4. \uC65C \uC774\uB7F0 \uB192\uC740 \uACF3\uC5D0\u2026\u2026? ", "\uC885\uB9D0\uC744 \uB9DE\uC740 \uC138\uACC4 \uAC19\uC740 \uC554\uD751. \uC5B4\uB460 \uC18D, \uB204\uAD70\uAC00\uC758 \uAE30\uCC99\uC774 \uAFC8\uD2C0\uAC70\uB9B0\uB2E4\u2026\u2026. ", "\uD3C9\uC628\uD55C \uC2DC\uAC04\uC774 \uC9C0\uB098\uAC04\uB2E4. \uB9C8\uCE58 \uADF8\uB7F0 \uC77C\uC740 \uC5C6\uC5C8\uB358 \uAC83 \uAC19\uB2E4. ", "\uBB3C\uBA39\uC740 \uD759\uC758 \uB0C4\uC0C8, \uB18D\uBC00\uD55C \uAE30\uCC99\uC774 \uD750\uB974\uB294 \uC232 \uC18D, \uC0C8\uB098 \uBC8C\uB808\uC758 \uC6B8\uC74C\uC18C\uB9AC, \uBC14\uB78C\uC5D0 \uD754\uB4E4\uB9AC\uB294 \uB098\uBB34\uB4E4\uC758 \uC18C\uB9AC\uAC00 \uB4E4\uB824\uC628\uB2E4. ", "\uC0AC\uB78C\uC774 \uB2E4\uB2C8\uAE30\uC5D4 \uC881\uC740 \uC8FC\uD0DD\uAC00. \uBAA8\uB974\uB294 \uC0AC\uB78C\uB4E4\uC774 \uC0AC\uB294 \uC9D1\uB4E4\uC5D0\uC11C \uC774\uB7F0\uC800\uB7F0 \uC18C\uB9AC\uB4E4\uC774 \uC0C8\uC5B4\uB098\uC640 \uC5B4\uB834\uD48B\uC774 \uB4E4\uB9B0\uB2E4\u2026\u2026. ", "\uAC11\uC790\uAE30 \uD558\uB298\uC744 \uAD6C\uB984\uC774 \uB36E\uB294\uB2E4. \uBE44\uAC00 \uAC70\uC138\uAC8C \uC3DF\uC544\uC9C4\uB2E4. \uC0AC\uB78C\uB4E4\uC740 \uCC98\uB9C8\uB97C \uCC3E\uC544 \uD5C8\uB465\uC9C0\uB465 \uB2EC\uB824\uAC04\uB2E4.", "\uD669\uD3D0\uD55C \uD3D0\uD5C8, \uC369\uC5B4 \uC0AC\uB77C\uC838\uAC00\uB294 \uC0DD\uD65C\uC758 \uD754\uC801. \uD76C\uBBF8\uD558\uAC8C \uB4E4\uB824\uC624\uB294 \uAC74 \uBC14\uB78C\uC77C\uAE4C, \uD30C\uB3C4 \uC18C\uB9AC\uC77C\uAE4C, \uC774\uBA85\uC77C\uAE4C. ", "\uC218\uB9CE\uC740 \uC0AC\uB78C\uB4E4. \uC2DC\uB044\uB7EC\uC6B4 \uC18C\uB9AC. \uB9E4\uC6B0 \uC18C\uB780\uC2A4\uB7EC\uC6B4 \uC810\uB0B4 BGM\uC5D0, \uBE44\uC815\uC0C1\uC801\uC778 \uC6C3\uC74C\uC18C\uB9AC. \uC2DC\uB044\uB7EC\uC6B4 \uBC88\uD654\uAC00\uC758 \uD55C \uACF3\uC774\uC9C0\uB9CC\u2026\u2026? ", "\uBC1D\uC740 \uBE5B\uC5D0 \uBE44\uCDB0\uC838, \uC548\uC2EC\uD558\uBA70 \uD55C\uC228. \uD558\uC9C0\uB9CC \uBE5B\uC774 \uAC15\uD574\uC9C0\uB294 \uB9CC\uD07C, \uADF8\uB9BC\uC790\uB3C4 \uC9D9\uC5B4\uC9C4\uB2E4. "];
      return self.$get_table_by_2d6(table);
    }, $Insane_Korean_get_scene_table$4.$$arity = 0);
    
    Opal.def(self, '$get_horror_scene_table', $Insane_Korean_get_horror_scene_table$5 = function $$get_horror_scene_table() {
      var self = this, table = nil;

      
      table = ["\uAC11\uC790\uAE30 \uC8FC\uBCC0\uC774 \uC5B4\uB450\uC6CC\uC9C4\uB2E4. \uC815\uC804\uC778\uAC00? \uC5B4\uB460 \uC18D\uC5D0\uC11C, \uB204\uAD70\uAC00\uAC00 \uB2F9\uC2E0\uC744 \uBD80\uB974\uB294 \uBAA9\uC18C\uB9AC\uAC00 \uB4E4\uB824\uC628\uB2E4. ", "\uB611. \uB611. \uB611. \uC5B4\uB514\uC11C\uC77C\uAE4C, \uBB3C\uBC29\uC6B8\uC774 \uB5A8\uC5B4\uC9C0\uB294 \uAC83 \uAC19\uC740 \uC18C\uB9AC\uAC00 \uB4E4\uB824\uC628\uB2E4.", "\uCC3D\uBB38 \uC55E\uC744 \uC9C0\uB098\uAC08 \uB54C, \uBB34\uC5B8\uAC00 \uAE30\uBD84 \uB098\uC05C \uAC83\uC774 \uBE44\uCCE4\uB2E4. \uB208\uC758 \uCC29\uAC01\uC778\uAC00\u2026\u2026? ", "TV\uC5D0\uC11C \uB274\uC2A4 \uC18C\uB9AC\uAC00 \uB4E4\uB824\uC628\uB2E4. \uC544\uBB34\uB798\uB3C4 \uADFC\uCC98\uC5D0\uC11C \uB4A4\uC22D\uC22D\uD55C \uC0AC\uAC74\uC774 \uC77C\uC5B4\uB09C \uAC83 \uAC19\uC740\uB370\u2026\u2026.", "\uC5B4\uB450\uC6B4 \uAE38\uC744 \uD63C\uC790 \uAC77\uACE0 \uC788\uB2E4. \uB4A4\uB85C \uAE30\uBD84 \uB098\uC05C \uBC1C\uC18C\uB9AC\uAC00 \uB2E4\uAC00\uC624\uB294 \uAC83 \uAC19\uC740 \uAE30\uBD84\uC774 \uB4DC\uB294\uB370\u2026\u2026. ", "\uB204\uAD74\uAE4C? \uACC4\uC18D \uC2DC\uC120\uC774 \uB290\uAEF4\uC9C4\uB2E4. \uB4A4\uB97C \uB3CC\uC544\uBD10\uB3C4 \uAC70\uAE30\uC5D0 \uC788\uB294 \uAC83\uC740 \uD3C9\uC18C\uC640 \uAC19\uC740 \uAD11\uACBD\uC778\uB370\u2026\u2026. ", "\uAC11\uC790\uAE30 \uD578\uB4DC\uD3F0 \uBCA8\uC18C\uB9AC\uAC00 \uC6B8\uB824 \uD37C\uC9C4\uB2E4. \uB9E4\uB108\uBAA8\uB4DC\uB85C \uD574\uB454 \uAC83 \uAC19\uC740\uB370\u2026\u2026. \uB300\uCCB4, \uB204\uAD6C\uD55C\uD14C \uC628 \uAC83\uC77C\uAE4C? ", "\uBE68\uAC04 \uBE5B\uC744 \uBE44\uCE58\uB294 \uC11D\uC591. \uD0DC\uC591\uC740 \uAC00\uB77C\uC549\uACE0 \uD558\uB298\uC740 \uD54F\uBE5B\uCC98\uB7FC \uC0C8\uBE68\uAC1B\uB2E4. \uBD88\uC548\uD55C \uAE30\uBD84\uC774 \uBC88\uC838\uAC04\uB2E4\u2026\u2026. ", "\uB9DB\uC788\uC744 \uAC83 \uAC19\uC740 \uB0C4\uC0C8\uAC00 \uD48D\uACA8\uC640, \uAC11\uC790\uAE30 \uACF5\uBCF5\uAC10\uC774 \uB290\uAEF4\uC9C4\uB2E4. \uC624\uB298\uC740 \uBB58 \uBA39\uC744\uAE4C? ", "\uC0C8\uB41C \uC6B8\uC74C\uC18C\uB9AC\uAC00 \uC6B8\uB824 \uD37C\uC9C4\uB2E4. \uAC11\uC790\uAE30 \uACF5\uBCF5\uAC10\uC774 \uB290\uAEF4\uC9C4\uB2E4. \uC624\uB298\uC740 \uBB58 \uBA39\uC744\uAE4C? ", "\uC7A0\uC744 \uC774\uB8E8\uC9C0 \uBABB\uD558\uACE0 \uB208\uC744 \uB72C\uB2E4. \uBB54\uAC00 \uC545\uBABD\uC744 \uAFBC \uAC83 \uAC19\uC740\uB370\u2026\u2026. \uC5B4\uB77C, \uC758\uC2DD\uC740 \uC788\uB294\uB370 \uBAB8\uC774 \uC6C0\uC9C1\uC774\uC9C0 \uC54A\uC544! "];
      return self.$get_table_by_2d6(table);
    }, $Insane_Korean_get_horror_scene_table$5.$$arity = 0);
    
    Opal.def(self, '$get_mania_scene_table', $Insane_Korean_get_mania_scene_table$6 = function $$get_mania_scene_table() {
      var self = this, table = nil;

      
      table = ["\uC774\uB07C\uAC00 \uB2EC\uB77C\uBD99\uC740 \uAC70\uB300\uD55C \uBC14\uC704\uAC00 \uB298\uC5B4\uC120, \uAC15\uC5D0 \uB5A0\uC624\uB978 \uC12C. \uBB34\uC5C7\uC744 \uBAA8\uC2DC\uACE0 \uC788\uB294\uC9C0\uB3C4 \uC54C \uC218 \uC5C6\uB294 \uC81C\uB2E8\uC774 \uC788\uACE0, \uC774\uB8E8 \uB9D0\uD558\uAE30 \uD798\uB4E0 \uBD84\uC704\uAE30\uAC00 \uB5A0\uC624\uB978\uB2E4.", "\uBB34\uD5C8\uAC00 \uC220\uC9D1. \uAC00\uD310\uB3C4 \uC5C6\uB294 \uC9C0\uD558\uC758 \uAC00\uAC8C\uB294, \uAC70\uB9AC\uC758 \uB0A8\uC790\uB098 \uD638\uC2A4\uD2F0\uC2A4\uB4E4\uB85C \uB5A0\uB4E4\uC369\uD558\uB2E4.", "\uC720\uC801 \uC548. \uB204\uAC00 \uC138\uC6E0\uB294\uC9C0\uB3C4 \uBAA8\uB974\uB294, \uBE44 \uC720\uD074\uB9AC\uB4DC \uAE30\uD558\uD559\uC801\uC778 \uAC74\uCD95\uC740, \uC548\uC744 \uAC77\uB294 \uC790\uC758 \uC815\uC2E0\uC744 \uC11C\uC11C\uD788 \uC880\uBA39\uC5B4\uAC04\uB2E4. ", "\uB300\uD559\uB3C4\uC11C\uAD00. \uC0AC\uC2ED\uB9CC\uC744 \uB118\uB294 \uC7A5\uC11C \uC18D\uC5D0\uB294, \uBAA8\uB3C5\uC801\uC778 \uB9C8\uB3C4\uC11C\uB3C4 \uC788\uB2E4\uACE0 \uD55C\uB2E4. ", "\uAC15\uD55C \uBC14\uB78C\uC744 \uB2E4\uACE0, \uC5B4\uB514\uC120\uAC00 \uBC14\uB2E4\uC758 \uB0C4\uC0C8\uAC00 \uD48D\uACA8\uC628\uB2E4. \uBC14\uB2E4\uB294 \uBA40\uB9AC \uC788\uC744\uD150\uB370\u2026\u2026. ", "\uC218\uB9CE\uC740 \uC0AC\uB78C\uB4E4\uB85C \uBD90\uBE44\uB294 \uAE38\uBAA9. \uC5EC\uAE30\uB77C\uBA74 \uB204\uAC00 \uC11E\uC5EC\uC788\uC5B4\uB3C4 \uC54C\uC544\uCC4C \uC218 \uC5C6\uC744 \uAC83\uC774\uB2E4. ", "\uAE4A\uC740 \uC5B4\uB460 \uC18D, \uADF8 \uB108\uBA38\uC5D0\uB294 \uB9D0\uB85C \uD45C\uD604\uD560 \uC218 \uC5C6\uB294 \uBB34\uC5B8\uAC00\uAC00 \uC228\uC5B4\uC788\uB294 \uB4EF \uD558\uB2E4. ", "\uC5ED\uC0AC \uC788\uB294 \uC2E0\uBB38\uC0AC. \uD734\uAC04 \uD55C \uBC88 \uC5C6\uC774 \uBC1C\uD589\uD55C \uBC31\uB144\uBD84\uC5D0 \uB2EC\uD558\uB294 \uC2E0\uBB38\uC774 \uBCF4\uAD00\uB418\uC5B4\uC788\uB2E4. ", "\uC624\uB798\uB41C \uBB18\uC9C0. \uBE44\uD2C0\uC5B4\uC9C4 \uB098\uBB34\uB4E4 \uC0AC\uC774\uC5D0 \uB0A1\uC544\uC11C \uBB18\uBE44\uBA85\uB3C4 \uC77D\uC744 \uC218 \uC5C6\uB294 \uBE44\uC11D\uC774 \uC11C\uC788\uB2E4. \uBA87 \uAC1C\uC778\uAC00\uC758 \uBE44\uC11D\uC740 \uC65C\uC778\uC9C0 \uAE30\uC6B8\uC5B4\uC838\uC788\uB2E4. ", "\uAC15\uAC00\uC758 \uACF5\uC7A5 \uD130. \uC544\uC8FC \uC624\uB798 \uC804\uBD80\uD130 \uC4F0\uC9C0 \uC54A\uC740 \uB4EF, \uAC74\uBB3C\uC740 \uBB34\uB108\uC838\uAC00\uACE0 \uC788\uB2E4. \uC544\uBB34\uB798\uB3C4 \uBD80\uB791\uC790\uB4E4\uC774 \uAC70\uCC98\uB85C \uC4F0\uACE0 \uC788\uB294 \uB4EF\uD558\uB2E4.", "\uC870\uC6A9\uD55C \uC2E4\uB0B4. \uBB34\uC5B8\uAC00 \uBD88\uC628\uD55C \uAE30\uC0C9\uC774 \uB290\uAEF4\uC9C0\uC9C0\uB9CC\u2026\u2026\uC800\uAC74 \uBB50\uC9C0? \uCC3D\uBB38\uC5D0, \uCC3D\uBB38\uC5D0!"];
      return self.$get_table_by_2d6(table);
    }, $Insane_Korean_get_mania_scene_table$6.$$arity = 0);
    
    Opal.def(self, '$get_dark_scene_table', $Insane_Korean_get_dark_scene_table$7 = function $$get_dark_scene_table() {
      var self = this, table = nil;

      
      table = ["\uC601\uB9E4\uC0AC\uB97C \uC911\uC2EC\uC73C\uB85C \uC6D0\uD0C1\uC744 \uC5D0\uC6CC\uC2FC \uC0AC\uB78C\uB4E4\uC774, \uAC15\uB839\uD68C\uB97C \uD558\uACE0 \uC788\uB2E4. \uC5B4\uB451\uD55C \uBC29 \uC548\uC5D0 \uC218\uC0C1\uCA4D\uC740 \uC5D1\uD1A0\uD50C\uB77C\uC998\uC774 \uD750\uB974\uAE30 \uC2DC\uC791\uD55C\uB2E4.", "\uB178\uB3D9\uC790\uB4E4\uC774 \uBAA8\uC774\uB294 \uD38D. \uC5EC\uAE09\uC774 \uB098\uB974\uB294 \uC5D0\uC77C\uC774\uB098 \uC9C4\uC744, \uBD89\uC740 \uC5BC\uAD74\uC758 \uB0A8\uC790\uB4E4\uC774 \uB4E4\uC774\uD0A8\uB2E4. ", "\uD53C \uB0C4\uC0C8\uAC00 \uD48D\uAE30\uB294 \uACF3. \uC5EC\uAE30\uC11C \uBB34\uC2A8 \uC77C\uC774 \uC788\uC5C8\uB358 \uAC83 \uC77C\uAE4C\u2026\u2026. ", "\uC0AC\uCC3D\uAC00\uAC00 \uB298\uC5B4\uC120 \uBE48\uBBFC\uAC00. \uAC74\uBB3C \uC55E\uC5D0\uB294 \uCC3D\uBD80\uB4E4\uC774 \uC190\uB2D8\uC744 \uAE30\uB2E4\uB9AC\uACE0 \uC788\uB2E4. ", "\uC0AC\uB78C\uB4E4\uB85C \uBD90\uBE44\uB294 \uB5A0\uB4E4\uC369\uD55C \uAC70\uB9AC. \uB2E4\uC591\uD55C \uC18C\uBB38\uC774 \uB5A0\uB3CC\uACE0 \uC788\uB2E4. \uB3D9\uC591\uC778\uC744 \uBE44\uB86F\uD55C \uC678\uAD6D\uC778\uC758 \uBAA8\uC2B5\uB3C4 \uBCF4\uC778\uB2E4. ", "\uC548\uAC1C\uAC00 \uC9D9\uC740 \uAE38\uBAA9. \uAC00\uC2A4\uB4F1\uC758 \uBE5B\uB9CC\uC774 \uB3CC\uB85C \uD3EC\uC7A5\uB41C \uAE38\uC744 \uBE44\uCD94\uC5B4 \uB4DC\uB7EC\uB0B4\uACE0 \uC788\uB2E4.", "\uC544\uC8FC \uC870\uC6A9\uD55C \uBC29 \uC548. \uC5EC\uAE30\uB77C\uBA74 \uBB58 \uD574\uB3C4 \uC4F8\uB370\uC5C6\uB294 \uBC29\uD574\uB294 \uBC1B\uC9C0 \uC54A\uACA0\uC9C0.", "\uAE30\uC801 \uC18C\uB9AC\uAC00 \uC6B8\uB9AC\uB294 \uBD80\uB450. \uC800 \uBC30\uB294 \uC678\uAD6D\uC73C\uB85C \uC5EC\uD589\uC744 \uB5A0\uB098\uB294 \uAC78\uAE4C.", "\uCC45\uC774 \uB118\uCCD0\uB098\uB294 \uACF3. \uBB54\uAC00\uB97C \uC870\uC0AC\uD558\uAE30\uC5D0\uB294 \uC548\uC131\uB9DE\uCDA4\uC774\uC9C0\uB9CC. ", "\uADC0\uC871\uC774\uB098 \uC790\uC0B0\uAC00\uB4E4\uC774 \uBAA8\uC778 \uD30C\uD2F0. \uD488\uC704 \uC788\uB294 \uBBF8\uC18C \uC544\uB798\uC5D0\uC11C\uB294 \uC5B4\uB5A4 \uD749\uACC4\uB97C \uAFB8\uBBF8\uACE0 \uC788\uB294 \uAC78\uAE4C. ", "\uC870\uC6A9\uD55C \uD638\uC218 \uBD80\uADFC \uD480\uC232\uC5D0\uC11C\uB294 \uC57C\uC0DD\uC758 \uD1A0\uB07C\uAC00 \uB6F0\uC5B4\uB2E4\uB2C8\uACE0 \uC788\uB2E4."];
      return self.$get_table_by_2d6(table);
    }, $Insane_Korean_get_dark_scene_table$7.$$arity = 0);
    
