    return (Opal.def(self, '$get_reaction_scene_table', $Insane_Korean_get_reaction_scene_table$39 = function $$get_reaction_scene_table() {
      var self = this, table = nil;

      
      table = ["\u300C\uC7A0\uC2DC \uC774\uCABD\uC73C\uB85C \uC640\uC8FC\uC2DC\uACA0\uC2B5\uB2C8\uAE4C\u3002\u300D\n \uAC11\uC790\uAE30 \uCCB4\uD3EC, \uAD6C\uC18D\uB2F9\uD55C\uB2E4. \u300C\uBC18\uC751\uD45C\u300D\uB97C \uC0AC\uC6A9\uD588\uB358\uCE90\uB9AD\uD130\uB294, \uC774 \uC52C\uC774 \uC885\uB8CC\uB418\uACE0 \uB098\uC11C, 2\uC52C \uB3D9\uC548, \uC790\uC2E0\uC774 \uC52C \uD50C\uB808\uC774\uC5B4\uAC00 \uC544\uB2CC \uC52C\uC5D0 \uB4F1\uC7A5\uD560 \uC218 \uC5C6\uAC8C \uB41C\uB2E4.\uFF08\uB9C8\uC2A4\uD130 \uC52C\uC5D0\uB294 \uB4F1\uC7A5 \uAC00\uB2A5\uFF09", "\u300C\uB0B4\uAC00 \uD611\uB825\uD560 \uC218 \uC788\uB294 \uAC74, \uC5EC\uAE30\uAE4C\uC9C0\uB2E4\u3002\u300D\n \uD611\uB825\uC744 \uAD6C\uD588\uB358 \uC778\uBB3C\uC740, \uAC81\uC744 \uBA39\uC740 \uB4EF\uD55C \uBAA8\uC2B5\uC73C\uB85C \uC190\uC5D0 \uB4E0 \uAFB8\uB7EC\uBBF8\uB97C \uB2F9\uC2E0\uC5D0\uAC8C \uAC74\uB124\uC8FC\uC5C8\uB2E4. \u300C\uBC18\uC751\uD45C\u300D\uB97C \uC0AC\uC6A9\uD588\uB358 \uCE90\uB9AD\uD130\uB294, \uC6D0\uD558\uB294 \uC544\uC774\uD15C 1\uAC1C\uB97C \uD68D\uB4DD\uD55C\uB2E4. ", "\u300C\uADF8 \uAC74\uC740 \uC218\uC0AC \uC911\uC785\uB2C8\uB2E4. \uC815\uBCF4\uC81C\uACF5 \uAC10\uC0AC\uD569\uB2C8\uB2E4\u3002\u300D\n \uD611\uB825\uC744 \uAD6C\uD588\uB358 \uC778\uBB3C\uC740, \uC0DD\uAE00\uC0DD\uAE00 \uC6C3\uC73C\uBA70 \uADF8\uB807\uAC8C \uB300\uB2F5\uD55C\uB2E4. \uBB34\uC5C7\uC744 \uBB3C\uC5B4\uBD10\uB3C4, \uB611 \uAC19\uC740 \uB300\uB2F5\uB9CC \uB418\uB3CC\uC544\uC628\uB2E4. \u300C\uBC18\uC751\uD45C\u300D\uB97C \uC0AC\uC6A9\uD588\uB358 \uCE90\uB9AD\uD130\uB294, \u3010\uC815\uC2E0\uB825\u3011\uC744 1\uC810 \uAC10\uC18C\uC2DC\uD0A8\uB2E4.", "\u300C\uD639\uC2DC \uC790\uB124, \uADF8 \uC0AC\uAC74\uC758 \uAD00\uACC4\uC790\uC778\uAC00\u2026\u2026?\u300D\n \uC544\uBB34\uB798\uB3C4 \uD611\uB825\uC744 \uAD6C\uD588\uB358 \uC778\uBB3C\uB3C4, \uB9C8\uCE68 \uAC19\uC740 \uC0AC\uAC74\uC744 \uC870\uC0AC\uD558\uACE0 \uC788\uC5C8\uB358 \uB4EF\uD558\uB2E4. \uC5EC\uB7EC \uAC00\uC9C0 \uC815\uBCF4\uB97C \uC81C\uACF5\uD574 \uC904 \uAC83 \uAC19\uB2E4. \u300C\uBC18\uC751\uD45C\u300D\uB97C \uC0AC\uC6A9\uD588\uB358 \uCE90\uB9AD\uD130\uB294, \uC774\uD6C4, \uC870\uC0AC\uD310\uC815\uC744 \uD560 \uB54C +1\uC758 \uC218\uC815\uC774 \uBD99\uB294\uB2E4.", "\u300C\uAFC8\uC774\uB77C\uB3C4 \uAFBC \uAC83 \uC544\uB2D9\uB2C8\uAE4C?\u300D\n \uC544\uBB34\uB9AC \uAC15\uD558\uAC8C \uD638\uC18C\uD574\uB3C4 \uBBFF\uC5B4\uC8FC\uC9C0 \uC54A\uB294\uB2E4. \u2026\u2026\uD639\uC2DC, \uC774\uC0C1\uD55C \uAC74 \uB0B4 \uCABD\uC774\uB780 \uAC74\uAC00? \uAC10\uC815\uC758 \uD2B9\uAE30\uBD84\uC57C\uC5D0\uC11C \uB79C\uB364\uC73C\uB85C \uD2B9\uAE30\uB97C 1\uAC1C \uACE8\uB77C \uACF5\uD3EC\uD310\uC815\uC744 \uD589\uD55C\uB2E4.", "\u300C\uB124\uB124, \uC6B0\uB9AC\uB4E4\uB3C4 \uD55C\uAC00\uD558\uC9C0 \uC54A\uB2E4\uAD6C\uC694\u3002\u300D\n \uC5EC\uB7EC \uAC00\uC9C0\uB97C \uC774\uC57C\uAE30\uD574\uB3C4 \uC0C1\uB300\uC870\uCC28 \uD574\uC8FC\uC9C0 \uC54A\uB294\uB2E4. \uBB38\uC804\uBC15\uB300\uB97C \uB2F9\uD55C\uB2E4. ", "\u300C\uC7A0\uC2DC \uC2E0\uCCB4\uAC80\uC0AC\uB97C \uD574\uB3C4 \uAD1C\uCC2E\uACA0\uC2B5\uB2C8\uAE4C?\u300D\n \uC218\uC0C1\uD55C \uC778\uBB3C\uB85C \uC5EC\uACA8\uC9C4 \uAC83 \uAC19\uB2E4. \u300C\uBC18\uC751\uD45C\u300D\uB97C\uC0AC\uC6A9\uD588\uB358 \uCE90\uB9AD\uD130\uAC00, \uC544\uC774\uD15C\uC774\uB098 \uC704\uBC95\uC778 \uB4EF\uD55C \uD504\uB77C\uC774\uC988\uB97C \uAC00\uC9C0\uACE0 \uC788\uC5C8\uC744 \uACBD\uC6B0, \uC774 \uC52C\uC774 \uC885\uB8CC\uB418\uACE0 \uB098\uC11C 2\uC52C \uB3D9\uC548, \uC790\uC2E0\uC774 \uC52C \uD50C\uB808\uC774\uC5B4\uAC00 \uC544\uB2CC \uC52C\uC5D0 \uB4F1\uC7A5\uD560 \uC218 \uC5C6\uAC8C \uB41C\uB2E4.\uFF08\uB9C8\uC2A4\uD130 \uC52C\uC5D0\uC11C\uB294 \uB4F1\uC7A5 \uAC00\uB2A5\uFF09", "\u300C\uADF8\uAC74 \uC2E0\uACBD\uC4F0\uC774\uB294\uAD70\uC694. \uC774\uCABD\uC5D0\uC11C\uB3C4 \uC870\uC0AC\uD574\uBCF4\uB3C4\uB85D\uD558\uC8E0\u3002\u300D\n \uC790\uAE30 \uC77C\uCC98\uB7FC \uC0C1\uB2F4\uC5D0 \uC751\uD574\uC900\uB2E4. \uBB54\uAC00 \uC54C\uAC8C\uB418\uBA74 \uC5F0\uB77D\uD574\uC8FC\uACA0\uB2E4\uACE0 \uB9D0\uD558\uC9C0\uB9CC\u2026\u2026. 1D6\uC744 \uAD74\uB9B0\uB2E4. \uD640\uC218\uB77C\uBA74, 2\uC52C \uD6C4\uC5D0 \uC815\uBCF4\uB97C \uAC74\uB124\uC900\uB2E4. \u300C\uBC18\uC751\uD45C\u300D\uB97C \uC0AC\uC6A9\uD588\uB358 \uCE90\uB9AD\uD130\uB294, \uC6D0\uD558\uB294 \u3010\uBE44\uBC00\u3011 1\uAC1C\uB97C \uD68D\uB4DD\uD55C\uB2E4. \uC9DD\uC218\uB77C\uBA74, \uC870\uC0AC\uD558\uACE0 \uC788\uB358 NPC\uAC00 \uC758\uBB38\uC0AC \uB2F9\uD55C\uB2E4. \u300C\uBC18\uC751\uD45C\u300D\uB97C \uC0AC\uC6A9\uD588\uB358 \uCE90\uB9AD\uD130\uB294, \uC9C0\uC2DD\uC758 \uD2B9\uAE30\uBD84\uC57C\uC5D0\uC11C \uB79C\uB364\uC73C\uB85C \uD2B9\uAE30 1\uAC1C\uB97C \uACE8\uB77C \uACF5\uD3EC\uD310\uC815\uC744 \uD55C\uB2E4.", "\u300C\uBAA9\uC228\uC774 \uC544\uAE5D\uB2E4\uBA74 \uC774 \uC774\uC0C1 \uAD00\uC5EC\uD558\uC9C0\uB9C8\u3002\u300D\n \uB2F9\uC2E0\uC740 \uC778\uAE30\uCC99\uB3C4 \uC5C6\uB294 \uACF3\uC73C\uB85C \uB04C\uB824\uAC00, \uAD6C\uD0C0\uB97C \uB2F9\uD588\uB2E4. \uD611\uB825\uC744 \uAD6C\uD588\uB358 \uC778\uBB3C\uC740, \uB3C4\uC6C0\uC744 \uCCAD\uD588\uC744 \uD130\uC778 \uB2F9\uC2E0\uC744 \uAC15\uD558\uAC8C \uAC70\uBD80\uD588\uB2E4. \u300C\uBC18\uC751\uD45C\u300D\uB97C \uC0AC\uC6A9\uD588\uB358 \uCE90\uB9AD\uD130\uB294 \u3010\uC0DD\uBA85\uB825\u3011\uC744 1\uC810 \uAC10\uC18C\uC2DC\uD0A8\uB2E4.", "\u300C\uC54C\uACA0\uC2B5\uB2C8\uB2E4. \uB9CC\uC77C\uC744 \uC704\uD574 \uD328\uD2B8\uB864\uC744 \uAC15\uD654\uD558\uB3C4\uB85D \uD558\uC8E0\u3002\u300D\n \uC8FC\uBCC0\uC758 \uACBD\uD638\uB97C \uC57D\uC18D\uD574\uC900\uB2E4. \u300C\uBC18\uC751\uD45C\u300D\uB97C \uC0AC\uC6A9\uD588\uB358 \uCE90\uB9AD\uD130\uB294, \uC774 \uC138\uC158 \uB3D9\uC548, \uD55C \uBC88\uC740 \uC790\uC2E0\uC774 \uC785\uC5C8\uB358 \uB370\uBBF8\uC9C0\uB97C \uBB34\uD6A8\uD654 \uC2DC\uD0AC \uC218 \uC788\uB2E4. \uB370\uBBF8\uC9C0\uB97C \uBB34\uD6A8\uD654 \uD588\uC744 \uACBD\uC6B0, \u300C\uBC18\uC751\uD45C\u300D\uB97C \uC0AC\uC6A9\uD588\uB358 \uCE90\uB9AD\uD130\uB294, \uD3ED\uB825\uC758 \uD2B9\uAE30\uBD84\uC57C\uC5D0\uC11C \uB79C\uB364\uC73C\uB85C \uD2B9\uAE30 1\uAC1C\uB97C \uACE8\uB77C \uACF5\uD3EC\uD310\uC815\uC744 \uD55C\uB2E4.", "\u300C\u2026\u2026\uBB50\uC57C \uC774\uB140\uC11D!?\u300D\n \uB3C4\uC6C0\uC744 \uAD6C\uD588\uB358 \uC0C1\uB300\uAC00 \uAC11\uC790\uAE30 \uC0AC\uB9DD\uD55C\uB2E4. \uB188\uB4E4\uC758 \uC190\uAE38\uC774, \uC774\uB7F0 \uACF3\uAE4C\uC9C0 \uBBF8\uCE58\uACE0 \uC788\uB294\uAC78\uAE4C? \u300C\uBC18\uC751\uD45C\u300D\uB97C \uC0AC\uC6A9\uD588\uB358 \uCE90\uB9AD\uD130\uB294, \uD3ED\uB825\uC758 \uD2B9\uAE30\uBD84\uC57C\uC5D0\uC11C \uB79C\uB364\uC73C\uB85C \uD2B9\uAE30 1\uAC1C\uB97C \uACE8\uB77C \uACF5\uD3EC\uD310\uC815\uC744 \uD55C\uB2E4."];
      return self.$get_table_by_2d6(table);
    }, $Insane_Korean_get_reaction_scene_table$39.$$arity = 0), nil) && 'get_reaction_scene_table';
